    false,nt"url": null,nt"notes": "NCEI Accession 0148077 includes physical
    and profile data collected aboard the ROGER REVELLE during cruise RR1502 in the
    Tasman Sea from 2015-02-06 to 2015-02-26. These data include CONDUCTIVITY, SALINITY
    and WATER TEMPERATURE. The instruments used to collect these data include CTD. These
    data were collected by Robert Pinkel of University of California - San Diego; Scripps
    Institution of Oceanography as part of The role of internal wave-driven near-bed
    turbulent dynamics in coastal ocean sediment mobilisation. The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling
